import { Menu } from "antd";
import React from "react";
import { Link } from "react-router-dom";
import { Layout } from "antd";
import bujo from "../images/bujo.png";
const { Header } = Layout;
function Navigation() {
  return (
    <div className="container-fluid">
      <div className="header">
        <div className="logo"><img src={bujo} className="logoImage" alt="exam express"></img></div>
        <Menu mode="horizontal" defaultSelectedKeys={["signup"]}>
          <Menu.Item key="home"><link to="/">Home</link></Menu.Item>
          <Menu.Item key="signup"><link to="/signup">Signup</link></Menu.Item>
          
        </Menu>
      </div>
    </div>
 
  );
}

export default Navigation;
